//libraries

contract SharedWallet {

//Type declarations

//State variables
    //uint public walletBalance;    //aggregate wallet balance
    address public owner;    //will have permission to withdraw any amount
    mapping(address => uint) public Allowances; //allowance as percentage of total
    uint public totalAllowances;    //total allowances allocated as a %


//Events
    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "You are not allowed - only the owner can do this.");
        _;
    }

//Functions

    //owner can set who gets an allowance
    function SetAllowance(address _beneficiary, uint _allowancePercentage) public onlyOwner {

        require(Allowances[_beneficiary] == 0, "The address already has an allowance");
        require(totalAllowances + _allowancePercentage < 100,"This would over-allocate the allowances");
        Allowances[_beneficiary] = _allowancePercentage;
        totalAllowances += _allowancePercentage;
    }

    //anyone can send to wallet
//    function ReceiveMoney() public payable {
//        walletBalance += msg.value;
        // this needs something to adjust the allowances
//    }

}


